<!DOCTYPE html>
<html>
<head>
    <title>Neo Browser 1.1.2</title>
    <style>
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }

        body {
            font-family: Arial, sans-serif;
            width: 100%;
            height: 100vh;
            position: relative;
            overflow: hidden;
        }

        .browser-window {
            display: flex;
            flex-direction: column;
            height: 100vh;
            width: 100%;
            position: relative;
        }

        #toolbar {
            position: absolute;
            top: 0;
            left: 0;
            right: 0;
            padding: 10px;
            background: #f5f5f5;
            border-bottom: 1px solid #ddd;
            display: flex;
            gap: 10px;
            align-items: center;
            z-index: 99999999;
            height: 60px;
            pointer-events: auto;
        }

        .nav-buttons {
            display: flex;
            gap: 5px;
            z-index: 99999999;
            pointer-events: auto;
        }

        button {
            padding: 8px 12px;
            background: #fff;
            border: 1px solid #ddd;
            border-radius: 4px;
            cursor: pointer;
            min-width: 40px;
            height: 40px;
            display: flex;
            align-items: center;
            justify-content: center;
            z-index: 99999999;
            pointer-events: auto;
        }

        button:hover {
            background: #f0f0f0;
        }

        .url-bar {
            flex: 1;
            display: flex;
            gap: 5px;
            z-index: 99999999;
            pointer-events: auto;
        }

        #urlInput {
            flex: 1;
            padding: 8px 12px;
            border: 1px solid #ddd;
            border-radius: 4px;
            font-size: 14px;
            height: 40px;
            z-index: 99999999;
            pointer-events: auto;
        }

        .content-area {
            flex: 1;
            margin-top: 60px;
            position: relative;
            height: calc(100vh - 60px);
        }

        #webview {
            width: 100%;
            height: 100%;
            border: none;
            position: absolute;
            top: 0;
            left: 0;
            right: 0;
            bottom: 0;
            z-index: 1;
        }

        .overlay {
            position: fixed;
            top: 0;
            left: 0;
            right: 0;
            height: 60px;
            background: transparent;
            z-index: 99999998;
            pointer-events: none;
        }

        /* Icons for navigation */
        .nav-icon {
            font-size: 18px;
            font-weight: bold;
            color: #333;
        }

        .home-icon {
            font-size: 20px;
            color: #333;
        }

        #display-warning {
            position: fixed;
            top: 60px;
            /* Below the toolbar */
            left: 0;
            right: 0;
            background-color: #ff4444;
            color: white;
            padding: 15px;
            text-align: center;
            z-index: 999999;
            font-weight: bold;
            display: none;
            animation: fadeIn 0.3s ease-in;
        }

        @keyframes fadeIn {
            from {
                opacity: 0;
            }

            to {
                opacity: 1;
            }
        }

        /* Add overlay when warning is shown */
        .warning-active .content-area {
            opacity: 0.7;
            pointer-events: none;
        }

        .exit-button {
            background-color: #dc3545;
            color: white;
            border: none;
            padding: 8px 16px;
            border-radius: 4px;
            cursor: pointer;
            font-weight: bold;
            margin-left: 10px;
            transition: background-color 0.2s;
        }

        .exit-button:hover {
            background-color: #c82333;
        }

        /* Update the url-bar class to accommodate the exit button */
        .url-bar {
            flex: 1;
            display: flex;
            gap: 5px;
            z-index: 99999999;
            pointer-events: auto;
            margin-right: 10px;
        }

        .browser-window.hide-toolbar #toolbar {
            display: none !important;
        }

        .browser-window.hide-urlBar #urlBar {
            display: none !important;
        }

        .browser-window.hide-urlBar #urlBar {
            display: none !important;
        }

        .browser-window.hide-toolbar .content-area {
            margin-top: 0;
            height: 100vh;
        }

        #error-message {
            animation: slideIn 0.3s ease-out;
        }

        /* Update toolbar layout for when URL bar is hidden */
        #toolbar {
            justify-content: space-between;
        }

        #loading-indicator {
            position: fixed;
            top: 50%;
            left: 50%;
            transform: translate(-50%, -50%);
            font-size: 24px;
            font-weight: bold;
            z-index: 1000;
            display: none;
        }

        .offline-warning {
            background-color: #ff4444 !important;
        }

        .back-arrow, .back-forward, .refresh button {
            pointer-events: auto;
            user-select: none;
            -webkit-user-select: none;
            outline: none !important;
            transition: all 0.2s ease-in-out;
        }

        .back-arrow:focus, .back-forward:focus, .refresh button:focus {
            outline: none !important;
        }

        #back-arrow.no-hover {
            pointer-events: none !important;
            cursor: not-allowed !important;
            opacity: 0.4 !important;
            background: #f5f5f5 !important;
            border-color: #ddd !important;
        }

        #back-arrow.no-hover:hover {
            background: #f5f5f5 !important;
            cursor: not-allowed !important;
        }

        #back-arrow:not(.no-hover):hover {
            background: #f0f0f0;
            cursor: pointer;
        }
        
        #webview:focus {
            outline: none !important;
        }
        @keyframes slideIn {
            from {
                transform: translate(-50%, -100%);
                opacity: 0;
            }

            to {
                transform: translate(-50%, 0);
                opacity: 1;
            }
        }
        .external-navigation #webview {
        z-index: 10 !important; /* Ensure webview is above other elements */
        }

        .external-navigation .content-area {
            z-index: 2 !important;
        }
    </style>
</head>

<body>
    <div class="browser-window">
        <div class="overlay"></div>
        <div id="toolbar">
            <div class="nav-buttons" id="nav-buttons">
                <button onclick="goBack()" class="back-arrow" id="back-arrow" title="Back">
                    <span class="nav-icon">←</span>
                </button>
                <button onclick="goForward()" title="Forward" class="back-forward">
                    <span class="nav-icon">→</span>
                </button>
                <div id="rld-btn" class="refresh">
                    <button onclick="refreshPage()" title="Refresh">
                        <span class="nav-icon">↻</span>
                    </button>
                </div>
            </div>
            <div class="url-bar" id="urlBar">
                <input type="text" id="urlInput" placeholder="Type a URL and press the Enter key">
                <!-- <button onclick="navigate()">Go</button> -->
            </div>

            <div class="exit-btn" id="exit-btn">
                <button onclick="exitApp()" class="exit-button" id="exit-button" title="Exit Browser">
                    Exit
                </button>
            </div>
        </div>
        <div class="content-area">
            <!-- <div id="loading-indicator">Loading!</div> -->
            <webview id="webview" src="http://localhost:4200" allowpopups partition="persist:mainwebview"
                webpreferences="allowRunningInsecureContent=yes, javascript=yes" nodeintegration="on"
                allowfileaccessfromfiles="true"
                webviewtag="true"
                allowtransparency="true"></webview>
        </div>
    </div>
